contract ANC is ERC20 {
    address public owner;

    constructor() ERC20("AncestryCoin", "ANC") {
        owner = msg.sender;
        // Mint 1,000,000 ANC to deployer (18 decimals)
        _mint(msg.sender, 1_000_000 * 10 ** decimals());
    }

